import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, colors} from '../../utilities';
import {SliderContainer} from '../Container';
import Castle from '../svg/Castle';

const Jumpings = ({className}) => {
  return (
    <SliderContainer className={className}> 
      <div className="icon"><Castle size={50}/></div>
      <h3>Jumpings</h3>
      <div className="text">
      <p>Tama√≥s chico, mediano, grande y jumbo</p>
      </div>      
    </SliderContainer>
  );
}

const SlideJumpings = styled(Jumpings)`
  background-image: linear-gradient(to right, ${colors.noryan_prpl}, ${colors.noryan_yellow}  );

`;

export default SlideJumpings;
